import React, { useEffect, useMemo, useState } from "react";
import api from "../../api/axios";
import SearchableSelect from "../../components/SearchableSelect";
import "../../styles/AdminPages.css";
import "../../styles/HousesList.css";

export default function HousesList() {
  const [monitors, setMonitors] = useState([]);
  const [err, setErr] = useState("");
  const [loading, setLoading] = useState(true);

  // filters
  const [fOwner, setFOwner] = useState("");
  const [fLocation, setFLocation] = useState("");
  const [fStatus, setFStatus] = useState("");

  const normalize = (v) => (v ?? "").toString().toLowerCase();
  const getMonitorId = (m) => (m.monitorId ?? "").toString();
  const getOwner = (m) => (m.email ?? "").toString();
  const getLocation = (m) => (m.location ?? "").toString();
  const getStatus = (m) => (m.status ?? "").toString();

  const load = async () => {
    try {
      setErr("");
      setLoading(true);
      const res = await api.get("/api/monitors");
      setMonitors(Array.isArray(res.data) ? res.data : []);
    } catch (e) {
      console.log("HOUSES LOAD ERROR:", e);
      setErr(e?.response?.data?.message || "Failed to load houses (from monitors).");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    load();
  }, []);

  // Build "houses" by grouping monitors by (owner + location)
  const houses = useMemo(() => {
    const map = new Map();

    monitors.forEach((m) => {
      const owner = getOwner(m);
      const location = getLocation(m);
      const status = getStatus(m);
      const monitorId = getMonitorId(m);

      const key = `${owner}__${location}`;

      if (!map.has(key)) {
        map.set(key, {
          owner,
          location,
          monitors: [],
          statusCounts: { online: 0, offline: 0, maintenance: 0, other: 0 },
        });
      }

      const item = map.get(key);
      item.monitors.push({ monitorId, status });

      const s = normalize(status);
      if (s === "online") item.statusCounts.online += 1;
      else if (s === "offline") item.statusCounts.offline += 1;
      else if (s === "maintenance") item.statusCounts.maintenance += 1;
      else item.statusCounts.other += 1;
    });

    return Array.from(map.values());
  }, [monitors]);

  const ownerOptions = useMemo(() => houses.map((h) => h.owner).filter(Boolean), [houses]);
  const locationOptions = useMemo(() => houses.map((h) => h.location).filter(Boolean), [houses]);
  const statusOptions = useMemo(() => ["online", "offline", "maintenance"], []);

  const filtered = useMemo(() => {
    const contains = (cell, typed) => normalize(cell).includes(normalize(typed).trim());

    return houses.filter((h) => {
      if (fOwner && !contains(h.owner, fOwner)) return false;
      if (fLocation && !contains(h.location, fLocation)) return false;

      // status filter: keep houses that have >= 1 monitor with that status
      if (fStatus) {
        const s = normalize(fStatus);
        const c = h.statusCounts[s] ?? 0;
        if (c <= 0) return false;
      }

      return true;
    });
  }, [houses, fOwner, fLocation, fStatus]);

  const clearFilters = () => {
    setFOwner("");
    setFLocation("");
    setFStatus("");
  };

  return (
    <section className="admin-page houses-page">
      <div className="admin-page-header">
        <h2 className="section-title">Houses</h2>

        <div className="houses-actions">
          <button type="button" className="secondary-button" onClick={load}>
            Refresh
          </button>
        </div>
      </div>

      <div className="houses-filters">
        <SearchableSelect label="Owner Email" value={fOwner} onChange={setFOwner} options={ownerOptions} />
        <SearchableSelect label="Location" value={fLocation} onChange={setFLocation} options={locationOptions} />
        <SearchableSelect label="Has Status" value={fStatus} onChange={setFStatus} options={statusOptions} />
        <button type="button" className="secondary-button houses-clear" onClick={clearFilters}>
          Clear filters
        </button>
      </div>

      {err && <div className="admin-error">{err}</div>}

      <div className="admin-table">
        <table className="admin-table-table">
          <thead>
            <tr>
              <th>Owner Email</th>
              <th>Location</th>
              <th>Status</th>
              <th>Monitor ID</th>
            </tr>
          </thead>

          <tbody>
            {loading ? (
              <tr>
                <td colSpan={7} className="houses-empty">Loading houses...</td>
              </tr>
            ) : filtered.length === 0 ? (
              <tr>
                <td colSpan={7} className="houses-empty">No houses found.</td>
              </tr>
            ) : (
              filtered.map((h) => (
                <tr key={`${h.owner}-${h.location}`}>
                  <td>{h.owner || "—"}</td>
                  <td>{h.location || "—"}</td>
                  <td>{h.statusCounts.online}</td>
                  <td>{h.statusCounts.offline}</td>
                  <td>{h.statusCounts.maintenance}</td>
                  <td className="houses-ids">
                    {h.monitors.map((x) => x.monitorId).filter(Boolean).join(", ") || "—"}
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </section>
  );
}
